import React, { useEffect, useState } from 'react';
import axios from 'axios';

function StockWidget() {
  const [stockData, setStockData] = useState({});
  const [error, setError] = useState(null);

  useEffect(() => {
    axios.get('https://twelve-data1.p.rapidapi.com/mutual_funds/world/ratings?symbol=VFIAX', {
      headers: {
        'x-rapidapi-key': '3836258f36msh5ec8f1e353d2889p18afc0jsn5f8eabe13803',
        'x-rapidapi-host': 'twelve-data1.p.rapidapi.com'
      }
    })
    .then(response => {
      console.log('Stock data fetched:', response.data); // Log the fetched data
      setStockData(response.data); // Update state with fetched data
    })
    .catch(error => {
      console.error('Error fetching stock data:', error);
      setError('Failed to fetch stock data'); // Set error state
    });
  }, []);

  if (error) return <div>{error}</div>;
  if (!stockData || Object.keys(stockData).length === 0) return <div>Loading...</div>;

  return (
    <div>
      <h2>Stock Data</h2>
      {/* Customize this based on the actual structure of the fetched data */}
      <p>Symbol: {stockData.symbol}</p>
      <p>Rating: {stockData.rating}</p>
      <p>Fund Name: {stockData.fund_name}</p>
    </div>
  );
}

export default StockWidget;
